  `get_user` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '接手买号',
  `get_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '接手时间',
  `remarks` char(255) DEFAULT '' COMMENT '备注',
  `appeal` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否被申诉',
  `timing` int(15) unsigned NOT NULL DEFAULT '0' COMMENT '定时任务',
  `finish` text NOT NULL COMMENT '完成度',
  `ddlOKDays` int(11) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

