  `takeover` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '接手任务数',
  `reward` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '奖励',
  `num` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '已完成人数',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED;

