-- ----------------------------
-- Table structure for mcs_task_taobao
-- ----------------------------
DROP TABLE IF EXISTS `mcs_task_taobao`;
CREATE TABLE `mcs_task_taobao` (
  `id` bigint(16) unsigned NOT NULL,
  `uid` mediumint(8) unsigned DEFAULT '0',
  `addtime` int(11) DEFAULT '0' COMMENT '添加时间',
  `tmpname` smallint(6) DEFAULT '0' COMMENT '使用模板',
  `accid` mediumint(8) unsigned DEFAULT '0' COMMENT '掌柜号',
  `goods_url` text COMMENT '商品链接地址',
  `goods_price` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '商品担保价格',
  `chssp` tinyint(3) unsigned DEFAULT '0' COMMENT '取消商品价格限制',
  `cbxIsGJ` tinyint(3) unsigned DEFAULT '0' COMMENT '是否改价',
  `cbxIsSB` tinyint(3) unsigned DEFAULT '0' COMMENT '是否商保',
  `txtMinMPrice` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '基本麦点',
  `pointExt` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '追加悬赏麦点',
  `ddlOKDay` tinyint(2) unsigned DEFAULT '0' COMMENT '要求确认时间',
  `isNoword` tinyint(3) unsigned DEFAULT '0' COMMENT '不带字好评',
  `isSign` tinyint(3) unsigned DEFAULT '0' COMMENT '真实签收任务',
  `Express` decimal(10,2) DEFAULT '0.00' COMMENT '真实签收麦点',
  `attrs` text COMMENT '增值服务',
  `total_points` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '任务所需总麦点',
  `task_type` tinyint(3) unsigned DEFAULT '0' COMMENT '任务类型',
  `task_other` text NOT NULL COMMENT '额外属性',
  `process` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '任务流程,0发布，1付款，2发货，3好评，4完成，5暂停 ，6已处理',
  `get_user` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '接手买号',
  `get_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '接手时间',
  `remarks` char(255) DEFAULT '' COMMENT '备注',
  `appeal` tinyint(3) DEFAULT '0' COMMENT '是否被申诉',
  `timing` int(15) unsigned DEFAULT '0' COMMENT '定时任务',
  `finish` text COMMENT '完成度',
  `ddlOKDays` int(11) unsigned DEFAULT '0' COMMENT '0立即好评,1 24小时内好评,.......',
  `cbxIsLook` tinyint(1) unsigned DEFAULT '0',
  `eqarea` varchar(255) DEFAULT '0' COMMENT '同省',
  `pinimage` tinyint(3) DEFAULT '0' COMMENT '好评需要截图',
  `fmingrade` tinyint(3) DEFAULT NULL COMMENT '接手积分限制(接手过滤)',
  `fmaxbbc` smallint(6) DEFAULT NULL COMMENT '拉黑次数限制(接手过滤)',
  `fmaxabc` tinyint(3) DEFAULT NULL COMMENT '满意度(n/%) 接手过滤',
  `fmaxcredit` smallint(6) DEFAULT NULL COMMENT '信誉限制(接手过滤)',
  `fmaxbtsc` int(11) DEFAULT NULL COMMENT '被投诉次数限制(接手过滤)',
  `needimg` tinyint(3) DEFAULT NULL COMMENT '需要好评晒图',
  `usid` int(10) DEFAULT '0' COMMENT '接受人id',
  `showtime` int(11) NOT NULL DEFAULT '0' COMMENT '显示时间, 0或空:忽略, >=1:满足此时间戳在大厅显示',
  `underimg` varchar(255) DEFAULT NULL COMMENT '底部截图',
  `aimg` varchar(255) DEFAULT NULL COMMENT '活动展示图片',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='大厅任务表';

