DROP TABLE IF EXISTS `mcs_users`;
CREATE TABLE `mcs_users` (
  `user_id` smallint(6) unsigned NOT NULL AUTO_INCREMENT,
  `user_name` varchar(36) NOT NULL DEFAULT '',
  `password` char(32) NOT NULL DEFAULT '',
  `safepass` char(32) NOT NULL DEFAULT '',
  `mobile_phone` varchar(11) NOT NULL DEFAULT '',
  `qq` varchar(16) NOT NULL DEFAULT '',
