  `user_rank` smallint(5) unsigned NOT NULL DEFAULT '0',
  `rank_expiry` int(11) unsigned NOT NULL DEFAULT '0',
  `brush_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '职业刷客',
