  `realname` varchar(50) DEFAULT NULL,
  `sex` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `send_address` varchar(30) DEFAULT '安徽省',
  `default_express` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '默认快递',
  `token` varchar(32) DEFAULT NULL COMMENT 'QQ登陆',
  `headimg` varchar(100) DEFAULT NULL COMMENT '头像',
  `chg_address` text COMMENT '签收快递信息',
  `business` decimal(6,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '商保金额',
  `business_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '退出商保申请时间',
  `reward` tinyint(3) unsigned DEFAULT NULL COMMENT '接手任务奖励',
