  `tousu` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '投诉清理',
  `is_ok` tinyint(3) NOT NULL DEFAULT '0' COMMENT '账号状态 1冻结 0正常',
  `statu` tinyint(1) unsigned NOT NULL DEFAULT '1',
  PRIMARY KEY (`user_id`)
) ENGINE=MyISAM AUTO_INCREMENT=53 DEFAULT CHARSET=utf8 COMMENT='用户信息表';

